import React from 'react'
import Nodes from './Nodes'
import { useState,U } from 'react';

export default function Graph() {
    // constructor(props){
    //     super(props);
    //     this.state ={
    //         nodes: []
    //     }
    // }
    const [nodes, setNodes] = useState([]);
    // const a=true;
    // const nodes= [];
    useEffect(() => {
        for(let row=0; row<20; row++){
            const currentRow=[];
            for (let col=0; col<10; col++){
                currentRow.push([]);
            }
            function sample(nextElement) {
                const next_arr = [...nodes, nextElement]
                setNodes(next_arr)
            };
            sample(currentRow)
            // nodes.push(currentRow)
        }
        
    }, [nodes]);
    console.log(nodes);
    return (
        <div className='grid'>
            <h1>Graph</h1>
            {nodes.map((row, rowIdx)=>{
                return(
                    <div key={rowIdx}> 
                        {row.map((node,nodeIdx) => {
                            return <Nodes key={nodeIdx} ></Nodes>
                        })}
                    </div>
                )
            })}
            
        </div>
    )
}
